import React , {Component} from 'react';

class App extends Component {

    constructor(){
        super()
        this.state = {
            number:0
        }
        
        this.clickHandler=this.clickHandler.bind(this);
    }

    clickHandler(){
        this.setState(function(prset){
            return{
                number:prset.number +1
            }
        })
    }
    

    render(){
        return(
            <div className='container text-center mt-5  '>
                <h1 className='mb-5'>{this.state.number}</h1>
                <button className='btn btn-success p-3 rounded-pill ' style={{}} onClick={this.clickHandler}>Plus</button> 

                <button className='btn btn-danger p-3 rounded-pill ' onClick={this.clickHandler}>moin</button>
            </div>
           
        )
    }
}

export default App;
